### Day 1989. 

#### Main Idea

1. Since the length of `num` can reach 10000, a brute-force approach of adding each digit of `num` multiplied by 10^[n-i] to form a number and then adding it to K is not feasible, as it would cause an overflow.

2. We can simulate manual vertical calculation by reversing the array and starting the addition from the last digit of both `num` and `k`.

3. Set a global variable `ex` to determine if a carry is needed when adding each digit.

   > [!NOTE]
   > Remember to check if there is a carry after adding the first digit.

4. If an array index exceeds the limit, treat it as 0; if `k` is shorter than `num`, treat the remaining digits of `k` as 0.


#### Code

```cpp
class Solution {
public:
    vector<int> addToArrayForm(vector<int>& num, int k) {
        int n = num.size();
        vector<int> res;
        int ex = 0;
        int i = n - 1;

        while (i >= 0 || k > 0) {
            int x = (i >= 0) ? num[i] : 0; //knum
            int y = k % 10;
            int sum = x + y + ex;
            res.push_back(sum % 10);
            ex = sum / 10;
            k /= 10;
            i--;
        }

        if (ex)
            res.push_back(ex);

        reverse(res.begin(), res.end());

        return res;
    }
};
```

#### Complexity

$O(Max(num.size(),  log(k)))$

### **Day 2821. **

#### Main idea

1. Two linear traversals: The first one records the distance from each `s[i]` to the previous `c` from left to right; The second time, from right to left, update the minimum distance compared to the previous distance
2.  Note: During the two initializations, the first initialization should be very small because there will be no appearance of `c` after traversing to the right for a long time. If the setting is not small enough, it will result in an insufficiently large distance value, which will affect the update of the correct value from right to left in the second traversal

```cpp
class Solution {
public:
    vector<int> shortestToChar(string s, char c) {
        int n = s.size();
        vector<int> res(n, n);
        int c_id = -n;

        for (int i = 0; i < n; i++) {

            if (s[i] == c) {
                c_id = i;
            }
            res[i] = i - c_id;
        }

        c_id = 2 * n;

        for (int j = n - 1; j >= 0; j--) {
            if (s[j] == c) {
                c_id = j;
            }

            res[j] = min(res[j], c_id - j);
        }

        return res;
    }
};
```

#### Complexity

Loop twice: $O(2*s.szie())$

